import React from "react";





function Signup(){

  const [email,setEmail] = useState('');
  const [pass,setPass] = useState('');
  const [fullname,setFullname] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(email);
  } 
  
  return (
    <>
        <form>
          <label for = "fullname" >fullname</label>
          <input value = {fullname} onChange = {(e) => setFullname(e.target.value)} type = "fullname" placeholder = "First Name Last Name" id = "fullname" name = "fullname" />
          <label for = "email">email</label>
          <input value = {email} onChange = {(e) => setEmail(e.target.value)} type = "email" placeholder = "youremail@gmail.com" id = "email" name = "email" />
          <label for = "password" >password</label>
          <input value = {pass} onChange = {(e) => setPass(e.target.value)} type = "password" placeholer = "*********" id = "password" name = "password" />
          <button type = "submit"> Sign Up </button>
        </form>
          <button> Already have an account? Sign In Here</button>
      </>
  );

}

  
export default Signup;
